import React, { Component } from "react";
import Input from "./Input";
import TextArea from "./TextArea";
import Select from "./Select";

class Form extends Component {
  render() {

    return (
      <div>
        <h1>Adicionar nova carta</h1>
        <Input inputLabel='nome da carta' tipo="text" testeId='name-input'/>
        <TextArea inputLabel='text area' testeId='description-input' />
        <Input inputLabel='Atributo 1' tipo="number" testeId='attr1-input'/>
        <Input inputLabel='Atributo 2' tipo="number" testeId='attr2-input'/>
        <Input inputLabel='Atributo 3' tipo="number" testeId='attr3-input'/>
        <Input inputLabel='Url IMG' tipo="text" testeId='image-input'/>
        <Select inputLabel="Raridade" testeId='rare-input'></Select>
        <Input inputLabel='Super Trunfo' tipo="checkbox" testeId='trunfo-input'/>


        </div>
    )
  }
}

export default Form
